import { StyleSheet } from "react-native";
const stylesNw = StyleSheet.create({
  container: {
    marginTop: 25,
    flexDirection: "column",
    display: "flex",
    backgroundColor: "#FFC232",
  },
  cardProduto: {
    backgroundColor: "#FF7070",
    marginVertical: 5,
    marginHorizontal: 5,
    borderRadius: 20,
    color: "#fff",
  },
  textCard: {
    backgroundColor: "#FF7070",
    marginVertical: 5,
    marginHorizontal: 5,
    borderRadius: 20,
    color: "#fff",
  },
});
export { stylesNw };
